class Solution:
    def shortestPalindrome(self, s: str) -> str:
        def palin(st,j):
            i=0
            
            while i<j:
                if st[i]!=st[j]:
                    return False
                i+=1
                j-=1
            return True
        if len(s)==0:
            return ""
        o=0
        if s.count(s[0])==40000:
            return ""
        
        
        
        
        for i in range(len(s)-1,-1,-1):
            if palin(s,i):
                return s[i+1:][::-1]+s
        
                